import React from "react";
import "./career.css";

export default function ImagesSection() {
  const leftTopImages = ["/images/img1.jpg", "/images/img2.jpg"];
  const leftBottomImage = "/images/img3.jpg";
  const rightImages = ["/images/img5.jpg", "/images/img6.jpg", "/images/img7.jpg"];

  return (
    <section className="images-section">
      <div className="images-layout">
        {/* LEFT COLUMN */}
        <div className="left-column">
          {/* Top two images side by side */}
          <div className="left-top">
            {leftTopImages.map((src, i) => (
              <img key={i} src={src} alt={`Left top ${i + 1}`} />
            ))}
          </div>

          {/* One image at bottom (centered) */}
          <div className="left-bottom">
            <img src={leftBottomImage} alt="Left bottom" />
          </div>
        </div>

        {/* CENTER CONTENT */}
        <div className="center-content">
          <p className="center-text">
            Discover our latest collection of amazing products.  
            Quality and style in one place.
          </p>
          <button className="center-button">Shop Now</button>
        </div>

        {/* RIGHT COLUMN (3 vertical images) */}
        <div className="right-column">
          {rightImages.map((src, i) => (
            <img key={i} src={src} alt={`Right ${i + 1}`} />
          ))}
        </div>
      </div>
    </section>
  );
}
